  ('Findo', 'antrop.', NULL, NULL, NULL, NULL, 'que parece haberse formado a par tir de pittó6. Se localiza en Baloeri. fósibbia, v. obligar, forzar; n la - a balakolá ko yo obligo a los trabajadores, we le fósibbie no me obligues. Pret. fósibiia, fó sibiesiia. fósibiesüa, pret. v. o fósibbia ; a abi tábítta ba - a batyelemán los militares obligaban a los presos. fósibiia, pret. v. o fósibbia ; o mmása áí a bo - sujefe le obligó', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Fosó', 'antrop.', NULL, NULL, NULL, NULL, 'construido a partir del verbo o fá y del adverbio OSSO. Debería escribirse Fáosso. Se localiza en Moeri', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('fufú', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. cuscús. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
