  ('Ganet', 'antrop.', NULL, NULL, NULL, NULL, 'adoptado de otra cultura africana. El a ntropónimo originario de los que se apellidan Ganet es Kallo. Está localizado en Bariobé', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Gobbe', 'antrop.', NULL, NULL, NULL, NULL, 'que significa "gavilán", "halcón" o "buitre". Gobbé nos remite a Kiippé. Está locali zado en Belebú, en Moka y en Ureka', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
