  ('Gori', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse Górí. Escrito Gori se referirá al plural del beju co. Está localizado en Batete', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
