  ('habé', 'adj.', NULL, NULL, 'Cl. 16', NULL, 'malo, mala, feo, fea. Concuerda con las palabras de la ; habba - lugar malo. háelessi, pret. v. o háella ; a batyelernán ba - e kobinna abetté los presos llena ban bidones para el gobierno, o bollá n bo - e ebolObOlló áí al niño yo le inflaba su globo. háella, v. inflar para. llenar para; n la botyo ekítoIlo a boppé lleno un cubo de agua para alguien. Pret. háeri, háelessi. háeri, pret. v. o háella ; a bakuerakueráa ba - o bue''iáa kusiánno yá boppé los alumnos llenaron bidones de agua para el maestro. haessi, pret. v. o haa ; n - yo extirpaba, o - t� extirpabas, a - él extirpaba, to - noso tros extirpábamos, 10 - vosotros extir pabais, ba - ellos extirpaban. háessi, pret. v. o háa ; elo ebari n e bihá birnmaa bi o tyóbbo á e eriia esta maña na llenaba todos los cubos de la casa del pueblo. hái, pret. v. o háa ; o - inflé, o - inflaste, a - infló, to - inflamos, 10 - inflasteis, ba - in f laron. haíam, pret. v. o haíanna ; i kuua kubaa o i - toda la ropa la planché. haíanessi, pret. v. ', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('hakookonno', 'adj.', NULL, NULL, 'Cl. 16', NULL, 'pequeño, pequeña. Concuerda con las palabras de la. Cfr. hakookoo', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('hakookoo', 'adv.', NULL, NULL, 'Cl. 16', NULL, 'pequeño, pequeña. Concuerda con las palabras de la ; habba - lugar pequeño. hákóra, v. perjudicar; o la le - me perjudicas, we le hakóre no me perjudi ques. Pret. hákória, hákóresiia. hákóresiia, pret. v. o hákóra ; o le me perjudicabas, o ta le - no me perjudicabas. hákória, pret. v. o hákóra ; o o - te perjudiqué, n tá o - no te perjudiqué', NULL, 'hakookonno', 'Fuente: bubi-español', 'import-script'),
  ('hakuerakueráa', 's.', NULL, NULL, NULL, NULL, 'pI. escolares, estudiantes, alumnos. el. 2. : "bokumbé")', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('hale', 'adj.', NULL, NULL, 'Cl. 16', NULL, 'dem. aquel, aquella. Concuerda con los nombres de la ; - habba aquel lugar', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('halé', 'adv.', NULL, NULL, NULL, NULL, 'allí; e tyóbbo ó botúkku é - la casa del jefe de poblado está allí. halelessi, pret. v. o halella ; o bO - e tyóbbo áí yo le destruía su casa. halella, v. destruir para alguien; o la bo - o wettya bO áí yo le destruyo su cabaña. Pret. halem, halelessi. halem, pret. v. o haIella ; o bo - e raatyé ri áí yo le destruí su cama. halessi, pret. v. o halla ; a abi tábítta ba - i tyóbbo kubbaa ya e eriia a kod da los militares destruían todas las casas del poblado de Kodda. hálessi, pret. v. o háUa ; 010 bOl lá a - o bOllá ó wettam este niño se parece al niño de mi her mana. halla, v. destruir, demoler, derribar, deshacer, desolar; e kobinna a la - e bilekúléku el gobierno derriba todos los antros. Pret. hari, halessi. hálla, v. parecer, asemejar. Pret. hám, hálessi. En este verbo la forma del presente es haaó', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('hállo', 'adv.', NULL, NULL, NULL, NULL, 'aquí; itáooo - siéntate aquí. halo, 1. adj. dem. este, esta. Concuerda con los nom bres de la CI. 16; - habba este lugar. 2. adv. aquí; -ahe aquí mismo, - bi''o aquí cerca, cerca de aquí. hám, pret. v. o hálla ; o - o boieffi me parezco a mi padre', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('hamma', 'adj.', NULL, NULL, 'Cl. 16', NULL, 'indo alguno, alguna. Concuerda con las palabras de la ; he - habba hay algún lugar. he 1 179', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
