  ('ikákka', 's.', NULL, NULL, 'Cl. 7', NULL, 'pi. cangrejos negros y amargos. CI. 8. ikelessi, pret. v. o ikella ; balo batyo to ba - e eriia alo a estas personas les insultábamos delante del pueblo. ikella, v. insultar, injuriar para alguien; n la o - 010 botyo insulto a esta persona para ti. Pret. ikeri, ikelessi. ikeri, pret. v. o ikella ; n bo - o bolláa bO e epátta o wetta m le insul té por la finca de mi hermana. ikessi, pret. v. o ikka ; n yo insultaba, o tú insulta bas, a él insultaba, to - nosotros insultábamos, lo - vosotros insultabais, ba - ellos insultaban. ikía, pret. v. o ikiáa ; n - ronqué, o - roncaste, a - roncó, to - roncamos, 10 - roncasteis, ba - roncaron. ikiáa, v. roncar, murmurar; n la - ronco, n tyí''a la - no ronco, o la roncas, o tyí''a la - no roncas, we ikiee no ronques, etc. Pret. ikía, ikiesiia. ikiesiia, pret. v. o ikkia ; e eriia e - o buello bO bobba bo a bÍokko el pueblo marcaba el límite de la tierra de Bioko. ikiesiia, pret. v. o ikiáa ; n - yo roncaba, 0- tú roncabas, a - él roncaba, to - nosotr', NULL, 'bikákka', 'Fuente: bubi-español', 'import-script');

