  ('kabakába', 's.', NULL, NULL, NULL, NULL, 'sing. muela. els. 9 y 10. Kabba, 1. antrop. que se refiere al vestido largo y amplio que se ponen las mujeres durante las fiestas. Está localizado en Batete. 2. s. sing. y pi. vestido amplio y largo que se ponen algunas mujeres africanas. els. 9 y 10. kabeem, pret. v. o kabella ; a bulla a - la doncella abrió grande mente las piernas. . . kabelessi, pret. v. o kabella ; n-yo abría grandemente las pier nas. . ., n ta - yo no abría grande mente las piernas. . . kabeUa, v. abrir grandemente las piernas y man tenerlas así distraídamente. Pret. kabeem, kabelessi', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('kábera', 'adv.', NULL, NULL, NULL, NULL, 'entonces; na a tá pooi - a tyá la le na''a si no vienes entonces no me quieres. kábiesiia, pret. v. o káya. Cfr. kabelessi. kábiia, pret. v. o káya. Cfr. kabeem', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Kabo', 'antrop.', NULL, NULL, NULL, NULL, 'prestado del español Cabo. Puede también provenir del verbo o kabba. Se localiza en Basakato de la Sagrada Familia. 206 1 kakára kakára, v. destruir, desolar, desordenar, revolver, desarreglar; o la - a lokko revuelves todas las cosas, we la - a lokko no revuelvas las cosas. Pret. kakária, kakáresiia. kakárea, v. destruirse, revolverse; e bilabba bi lá - los hechos se revuelven. Pret. kakárei, kakáreseei. kakárei, pret. v. o kakárea ; e tyóbbolÍl e -la e pullá mi casa se destruyó con la tormenta. kakáreseei, pret. v. o kakárea ; e bilabba bi - los hechos se revolvían, i tyóbbo i - las casas se des truían. kakáresiia, pret. v. o kakára ; a bapulákke ba i - i tyóbbo kub baa i e eriia wela los extranjeros des truían todas las casas del pueblo. kakária, pret. v. o kakára ; e kobinna a - o tokutúm tommaa to a ripotto el gobierno destruyó todas las chabo las de la ciudad', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
