  ('kallá', 's.', NULL, NULL, NULL, NULL, 'sing. pangolín. Cls. 9 y 10. kalla, v. llevar en la cabeza; n la - e ribetté yo llevo el bidón sobre la cabeza. Pret. kari, kalessi', NULL, 'o alláa', 'Fuente: bubi-español', 'import-script'),
  ('kallo', 's.', NULL, NULL, NULL, NULL, 'sing. rodete para llevar carga sobre la cabeza. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
