  ('kantyotyo', 's.', NULL, NULL, 'Cl. 1', NULL, 'pI. sarampiones. Cl. ID', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('kapatássi', 's.', NULL, NULL, NULL, NULL, 'sing. capataz. Cls. 9 y 10. kapátya, v. berrear, bramar; e pókkó é la - el buey berrea. Pret. kapátyiia, kapátyesiia. kapátyesiia, pret. v. o kapátya ; e esóló é - el cerdo bramaba. kapátyiia, pret. v. o kapátya ; e esóló é - el cerdo bramó. kapea, v. estropearse, averiarse; a lokko la lá - las cosas se estropean. Pret. kapei, kapieseei. kapei, pret. v. o kapiia ; o wet t ya bo - la cabaña se estropeó. kapelessi, pret. v. o kapella ; n yo estropeaba para, o - tú estropeabas para, a él kassí / 207 estropeaba para, to - nosotros estropeábamos para, 10 - vosotros estropeabais para, ba - ellos estropeaban para. kapelessi, pret. v. o kapella ; n - o bo''e yo enfardaba la car ga, n bO - yo lo enfardaba. kapeUa, v. estropear para, destrozar para, etc; a baseseppe ba lá le - e empam los muchachos estropean mi asiento. Pret. kapem, kapelessi. kapella, v. enfardar, embalar; 010 botyo a la - e bekutta be áí esta persona embala sus mantas. Pret. kapem, kapelessi. kapem, pret. v. o kapella ; n bo e ', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('kapiñta', 's.', NULL, NULL, NULL, NULL, 'sing. y pi. carpinteros. Cls. 9 y 10. kappa, v. destrozar, destruir, malgastar, estro pear, desperdiciar, derrochar, malversar, malear, despilfarrar, deteriorar, peIjudicar; 10 la - e tyób bo áno la i tyokko i áno vosotros destrozáis vuestra casa y despilfarráis vuestro dinero. Pret. kappi, kapessi. kappi, pret. v. o kappa ; o boitta a - e ebéló áí el gobernador malgastó su tiempo', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('kappí', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. remos, paletas. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('karanáte', 's.', NULL, NULL, NULL, NULL, 'sing y pI. cacahuetes. Clases 9 y 10. kari, pret. v. o kalla ; n-e empam \levo mi asiento sobre mi cabeza. karíbba, v. asustarse, espantarse; e puá e lá la e pittóo el perro se asusta con la bocina. Pret. karíbbi, karíbessi. karíbbi, pret. v. o karíbba ; e puá e le haúbe n-el perro, al ladrar, me asusté. karíbessi, pret. v. o karíbba ; n-me asustaba, o - te asustabas, a - se asus taba, to - nos asustábamos, 10 - os asustabais, ba - se asustaban. karíbia, v. asustar, espantar; e erikirikki o mmo e lá - a batyo bammaa la sombra del demo nio asusta a toda la gente, we le karíbbie no me asustes. Pret. karíbiia, karíbiesiia. karíbiesiia, pret. v. o karíbia ; o bonolla m n bO - a mi abuela le asustaba. karíbiia, pret. v. o karíbia ; o le - me has asustado', NULL, 'arí', 'Fuente: bubi-español', 'import-script'),
