  ('kelle', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. 1. maravilla, milagro. 2. barba ridad. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Kenero', 'antrop.', NULL, NULL, NULL, NULL, 'localizado en Rebola. Se refiere a alguien de quien se tienen noticias. kenessi, pret. v. o kénna ; to - o topoya nosotros matábamos las polillas. kenna, v. matar con las uñas; n la - o boakki yo mato al piojo con mis uñas. pisotear a alguien, maltratarle; o boitta a la - a batyo sóté el mandatario maltrata mucho a la gente. Pret. kénni, kénessi. kenni, pret. v. o kénna ; o boakki n bo - el piojo lo maté con mis uñas', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('keoo', 'adj.', NULL, NULL, NULL, NULL, 'pocos, pocas. Concuerda con las pala bras de la CI. 10; kuua - pocas telas, pocos lienzos', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('keppé', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. llagas. Cls. 9 y 10. Ej. expr. e puá é - el perro tiene llagas. kesessí, pret. v. o kessá ; n yo descuartizaba, o - tú descuartizabas, a - él descuartizaba, to - nosotros descuartizábamos, 10 - vosotros descuartizabais, ba - ellos descuar tizaban. . �iia. kessá, v. trocear, descuartizar; e isaké ri lá e ite el machete trocea la piedra. Pret. kessí, kesessí', NULL, 'ketye', 'Fuente: bubi-español', 'import-script'),
  ('kesse', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. dichos, refranes. Cls. 9 y 10; o boyolla ro a la le tówálla la - mi abuelo habla conmigo con refranes. kessí, pret. v. o kessá ; n - e nabba troceé la carne, n ta e nabba no troceé la carne. Th. ketyía', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('ketekette', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. arbusto de hojas pinnadas redondeadas en los extremos y con flores amari llas y vistosas. Clases 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('kette', 's.', NULL, NULL, 'Cl. 10', NULL, 'pI. azadas, palos para cavar, palancas. ', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('ketto', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. veces, turnos; - yé mpa dos veces. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('ketya', 's.', NULL, NULL, NULL, NULL, 'pI. helechos. CI. 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('kétyá', 's.', NULL, NULL, 'Cl. 1', NULL, 'pI. vestidos, ropas. CI. 10. ketya, v. partir, desmenuzar, descuartizar, tajar; a baebba ba lá - e nabba los vinateros parten la carne. Pret. kétyía, ketyesiia. ketyesiia, pret. v. o ketya ; n-o lóÓlÍl yo partía el leño, n-e nabba yo partía la carne, ne -lo partía. ketyía, pret. v. o ketya ; ne - e nabba partí la carne en trozos, ne - lo partí. ketyólessi, pret. v. o ketyólla ; n-o botté yo descuartizaba el árbol, n bo - yo lo descuartiza ba, o - e nabba tú descuar tizabas la carne, we - lo descuartizabas, n bo - o boheIé, to ri - e ite nosotros descuartizábamos la piedra, to ri - lo descuartizábamos. ketyólla, v. descuartizar, desmenuzar; o bOie a la - o botté el hombre descuartiza el árbol. Pret. kétyóm, ketyólessi. ketyóm, pret. v. o ketyólla ; n-o bo''ó descuarticé la caña de azúcar', NULL, 'o kessá', 'Fuente: bubi-español', 'import-script'),
  ('kí', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. llaves de cualquier tipo. cla ves. Cls. 9 y 10. kibbia, v. parar, interrumpir, detener; e sotyá si lá - o motóo el policía para el coche. Pret. kibiia, kibiesiia. kibiesiia, pret. v. o kibbia ; e iporoporo bi - a batyo los soldados paraban a las personas. kibiia, pret. v. o kibbia ; e kobinna e - e elako el gobierno interrumpió el trabajo', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('kíhá', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. tortugas. Cls. 9 y 10. Tb. esapúsappú. kikira, v. cortar o arrancar la hierba sin que quede nada en la tierra; a bakuerakueráa ba lá - los escolares 210 I kikiresiia arrancan la hierba sin que quede nada en la tierra. Pret. kikiria, kikiresiia. kikiresiia, pret. v. o kikira ; elo ebari n-e eruppú esta mañana arrancaba de cuajo la hierba. kikiria, pret. v. o kikira ; n bi - e biruppú arranqué de cuajo las hierbas', NULL, NULL, 'Fuente: bubi-español', 'import-script');

