  ('kosso', 's.', NULL, NULL, NULL, NULL, 'sing. acierto, correcto, etc. Cls. 9 y 10. Ej. expr. e bilabba bi tyí oppáa e - las cosas no salen bien', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Kota', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse Kótaa. Se localiza en Belebú. kótebia, v. tomar el pelo; e bobbé e lá - o boyol la el nieto toma el pelo al abuelo, we le kótebbie no me tomes el pelo. Pret. kótebiia, kótebiesiia. kótebiesiia, pret. v. o kótebia ; o tomaba el pelo, o - tomabas el pelo, a - tomaba el pelo, to - tomábamos el pelo, 10 - tomabais el pelo, ba - tomaban el pelo. kótebiia, pret. v. o kótebia ; o tomé el pelo, o - tomaste el pelo, a - tomó el pelo, to - tomamos el pelo, lo - tomasteis el pelo, ba - tomaron el pelo', NULL, 'o pobbá', 'Fuente: bubi-español', 'import-script'),
  ('kotee', 'adj.', NULL, NULL, NULL, NULL, 'sing. y pi. grande, voluminoso, impor tante, destacado. Concuerda con las palabras de las Cls. 9 y 10; e bappa - la serpiente grande, i bappa - las serpientes grandes. kótessi, pret. v. o kótta ; o - amontonaba, o - amontonabas, a amontonaba, to - amontonábamos, 10 - amonto nabais, ba - amontonaban. kotóbaam, pret. v. o kotóballa ; n - kóri o ta ekessi e rikottom álo yo tropecé porque no miraba dónde ponía mi pie. kotóbalessi, pret. v. o kotóballa ; to - a bate nosotros tropezábamos con las piedras. kotóballa, v. tropezar, chocar; o la - kóri o la etta e etyíó tropiezas porque caminas por la noche', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('kotobítyo', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. huella. paso. CIs. 9 y 10. kótta, v. amontonar, agrupar, reunir; n la - e bimmálOtom yo amon tono mis piñas de cacao. Pret. kotyí, kotessi', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
