  ('Kula', 'antrop.', NULL, NULL, NULL, NULL, 'que se refiere a una especie de boti jo o cántaro. Se localiza en Baney. kulessi, pret. V. o kulla ; n - i pillá e ebarityio yo reco gía los dátiles muy de mañana, o - e beakká o mpári tú recogías tus almendras ayer', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
