  ('lehílehí', 's.', NULL, NULL, NULL, NULL, 'sing. molestón, camorrista, beligeran te. Cls. 9 y 10. Lehri, antrop. en el que no se justifica la hache. Debería escribirse Lerí. Se localiza en Baresó. lekelessi, pret. V. o lekélla ; n yo drenaba, o - tú drenabas, a - él drenaba, to nosotros drenábamos, 10 - vosotros drenabais, ba - ellos drenaban. 220 I lekélessi lekélessi, pret. v. o lekélla ; o boyolla a - e empa wela el abuelo dormitaba en el asiento. lekella, v. canalizar, drenar; n la - a boppé bá o lóllá yo canalizo el agua de la lluvia. Pret. lekeri, lekelessi. tekélla, v. dormitar, adormecerse, cabecear. Pret. lekém, lekélessi. tekém, pret. v. o lekélla ; n-me adormecí, o - te adormeciste, a - se ador meció, ro - nos adormecimos, 10 - os adormecis teis, ba - se adormecieron. lekeri, pret. v. o lekella ; n drené, o - drenaste, a - drenó, to - drenamos, 10 - drenasteis, ba - drenaron. lekessi, pret. v. o lekka ; o obessé a batyo bamma ba - en el poblado todas las personas se ponían en fila. lekiesiia, pret. v. o lekkia ; e ep', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('leláe', 'adv.', NULL, NULL, NULL, NULL, 'nada, ni un ápice; labba - nada de nada', NULL, 'leláJIe', 'Fuente: bubi-español', 'import-script'),
