  ('lellá', 'adj.', NULL, NULL, 'Cl. 6b', NULL, 'indo otro, otra. Concuerda con las pala bras de la ; labba - otra cosa', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('lelle', 'adv.', NULL, NULL, NULL, NULL, 'bien, buenamente; le - está bien', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('leoo', 'adj.', NULL, NULL, 'Cl. 6b', NULL, 'poco, poca. Concuerda con las palabras de la ; labba - poca cosa. lepea, v. esconderse, ocultarse; n la ba leppo yo me oculto, n la - yo me escondo. Pret. lepei, lepieseei. lepei, pret. v. o lepea ; n me oculté, o - te ocultaste, a - se ocultó, to - nos ocultamos, lo - os ocultasteis, ba - se ocultaron. lepelessi, pret. v. o lepella ; o bOyolIa n bo - e isaké ri áí al abuelo le guardaba su machete. lepella, v. guardar/ocultar/esconder algo a alguien; n la o - eruua yo te guardo sitio. Pret. lepem, leperi, lepelessi. lepem, pret. v. o lepella ; o bOnatú''olÍl a le - e eruua mi hermano mayor me guardó el sitio. leperi, pret. v. o lepella; to bo - e bilabba nosotros le ocultamos los hechos. lepessi, pret. v. o leppa ; a abObée ba - e bitataa bi ábo los bubis escondian sus escopetas. lepetessi, pret. v. o lepetta ; n - yo tenía mucho frío, o - tú tenías mucho frío, a - él tenía mucho frío, to - nosotros te níamos mucho frío, lo - vosotros teníais mucho frío, ba - eIlos te nían mucho frío. l', NULL, 'lepem', 'Fuente: bubi-español', 'import-script'),
  ('lette', 'adv.', NULL, NULL, NULL, NULL, 'verídico, cierto; - n ka poa''á obari de verdad iré mañana. Iewera, v. fijarse, observar. Pret. lewereei, lewereseei; o lá na o te parí e esoko kábera na o te e - o dicen que si no has llegado a ser joven entonces nadie se habrá fijado en ti. lewereei, pret. v. o lewera ; n- e bilabba observé los hechos. lewereseei, pret. v. o lewera ; a batyo ba - e kobinna la gente se fijaba en el gobierno', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('leUo', 'adv.', NULL, NULL, NULL, NULL, 'hoy; - to pa''e o tó''ólla kóri o bOitta a''a húbiia hoy podemos hablar porque el jefe ha huído', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('lIepa', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir del verbo o leppa. Puede traducirse por "almacén", "escondite", "refugio", etc. Se locali za en Baney', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
