  ('lOakke', 'S.', NULL, NULL, 'Cl. 11', NULL, 'sing. atado, atadura. parto. . lóálessi, pret. V. o lóálla ; i pillá n i - bate los dáti les los machacaba con piedras. lóálla, V. machacar con, moler con, etc. Pret. lóám, lóálessi. lóám, pret. V. o lóálla ; to beto''o molimos con pilones', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('loantyotyo', 'S.', NULL, NULL, 'Cl. 10', NULL, 'sing. sarampión. CI. 11. loátessi, pret. V. o loátta ; o botyo a - e puá la per sona mordía al perro. loátta, V. morder, mordisquear; o bOllá a la e ribelle ri o oberíi áí el niño muerde el seno de su madre. Pret. loátyi, loátessi. loátyi, pret. V. o loátta ; e puá e - o bokobbe el perro mordisqueó el plátano. Loba, antrop. que debería escribirse Lo''obbá. Pero si tenemos en cuenta el verbo o obba, obtendremos el término Lo''obba. Se localiza en Sampaka', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
