  ('mmo', 's.', NULL, NULL, NULL, NULL, 'sing. demonio, diablo, fantasma. difunto. el. I ; na - na botyo a heye a beUá né demonio o persona, que seque mis lágrimas, o - la morada de los demonios. mmOla, v. preparar; to la ba - o nos estamos preparando. Pret. mmo ri, mmolessi. mmOlessi, pret. v. o mmola ; n la - a lokko yo preparaba las cosas. Tb. uoless;. mmora, v. preparar, prepararse; n ba - o me preparé. efr. o mmola. mmori, pret. v. o rnmOla ; n-e bilab ba preparé los asuntos, los hechos. ', NULL, 'o uolla', 'Fuente: bubi-español', 'import-script');

