  ('Muebake', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse Mueebá ké. Se locali za en Basuala y en Basakato de la Sagrada Familia', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mueda', 'antrop.', NULL, NULL, NULL, NULL, 'que nos remite a Meda. Se localiza en Ruiché. Muelachoa, antrop. obtenido a partir del verbo o elláa y del sustantivo t yooa. Muelátyooa se referirá a alguien que ve o encuentra las termitas blancas. Mueñe, antrop. cuya traducción apro ximada es "espinilla". Tam bién parece provenir de moenya. Se localiza en Batete', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Muera', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse Muera. Se localiza en Belebú', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Muerabitá', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir del verbo o muera y del sustanti vo bittá. Antiguamente Muerabittá se refería a aquellas personas que guardaban el secreto del ritual que permitía tener una buena cosecha de aceite. Se localiza en Moeri. Muhaleri, antrop. que debería escribir se Mo''áleri. Se trata de alguien con quien resulta fácil ponerse de acuerdo. Se localiza en Ureka', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mulé', 'antrop.', NULL, NULL, NULL, NULL, 'numeral que hace referencia a "primero". Se localiza en Belebú. N n, 1. pref sujo yo; - sossi yo leí, - sosessi yo leía, ka sosá''á yo leeré, - tyá sossa yo no leo. 2. prtv. es; - tyóbbo es una casa, - tyebbá es un sueño', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('na''u', 'S.', NULL, NULL, 'Cl. 11', NULL, 'pi. verduras amargas. hierba moras. CI. 10. Tb. nekku', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nabba', 'S.', NULL, NULL, NULL, NULL, 'sing. y pI. carne cruda. animal salvaje, fiera. bárbaro, salvaje, bestia, bruto, feroz. Cls. 9 y 10 ; n ka ra''á - voy a comer carne, 010 bOtyo - esta persona es un animal salvaje; - bo''í animal muerto. n abOlessi, pret. V. o nabolla ; e biátto be - los barcos navegaban. nabolla, V. navegar; e sitímma si lá - el bar co navega. Pret. naborí, nabolessi. nabori, pret. V. o nabolla ; e biátto be los barcos navegaron', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Naele', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir de enaéle. Naéle se localiza en Baney. nakessi, pret. V. o nakká ; n bo - yo le echaba. nakká, V. echar, rechazar a alguien; o waísso a la - o bOie la mujer rechaza al hombre. Pret. nakkí, nakéssi. nakkí, pret. V. o nakká ; n - 010 botyo eché a esta per sona, to - a abitábítta recha zamos a los militares', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nakko', 'S.', NULL, NULL, NULL, NULL, 'sing. y pI. vulva, vagina. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nalle', 'S.', NULL, NULL, NULL, NULL, 'sing. 1. mármol, pavimento, piedra de amolar 2. ciudad; na hella i - puá voy a la ciudad. Cls. 9 y 10. 240 I Narnasó Narnasó, an/rop. cuyo significado aproximado es "animal o bestia que es o existe". Se localiza en Baney', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nanakóbbo', 's.', NULL, NULL, NULL, NULL, 'sing. y pi. pellejos, pieles. Cls. 9 y JO. nánéa, v. enredarse; e epetté be la - las cuerdas se enredan. Pret. nánéi, nánéseei. nánéi, pret. v. o nánéa ; e bilabba bi los hechos se enredaron. náneseei, pret. v. o nánéa ; e bilabba bi - los hechos se enredaban. nánessi, pret. v. o nánáa ; n yo enganchaba, o - tú engan chabas, a - él enganchaba, to - nosotros enganchábamos, 10 - vosotros enganchabais, ba - ellos enganchaban. náníi, pret. v. o nánáa ; e bilabba bi - los hechos se enredaron', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Nanito', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir del verbo o nánáa y el sustantivo plural j to. Náníto se localiza en Rebola', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Napa', 'antrop.', NULL, NULL, NULL, NULL, 'que presenta dos significados. En primer lugar, se referirá a la "podadera" o al "cuchillo para podar". En segundo lugar, signifi cará "mamar" o "chupar". En este último caso se refiere al verbo o nappá. Se localiza en Baney. napessí, pre/. v. o nappá ; o bollá a ta lelle el niño no mama ba bien. napía, pret. v. o nappiá ; e póríi e o obitya la cabra ama mantó al ratón. napiesiia, pret. v. o nappiá ; n-yo amamantaba, o - tú amamantabas, a él ama mantaba, to - nosotros amamantábamos, lo vosotros amamantabais, ba ellos amaman taban', NULL, 'ápessi', 'Fuente: bubi-español', 'import-script');

-- Lote 161 (entradas 4001 a 4025)
INSERT INTO dictionary_entries (
  bubi, word_type, gender, number, nominal_class, plural_form,
  spanish, examples, variants, notes, created_by
) VALUES
  ('Napo', 'antrop.', NULL, NULL, NULL, NULL, 'cuyo significado aproximado es "dátil" de la palmera de aceite. Se localiza en Basakato de la Sagrada Familia', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nappa', 's.', NULL, NULL, NULL, NULL, 'sing. y pi. cuchillo podador. Cls. 9 y 10. nappá, v. mamar; e sine''e si lá - el bebé mama. Pret. nappí, napéssí. nappí, pret. v. o nappá ; 010 botyo ata abelle roló botSo ata náppi abelle] esta persona no ha mamado leche materna. nappiá, v. amamantar; e póríi karí e lá - e sipóríi la cabra amamanta al cabrito. Pret. napía, napiésiia. naríbba, v. dispersarse; o tonorí to lá - la e ekokoo e etataa los pájaros se dispersan con el disparo de la escopeta. Pret. naríbbi, naríbessi. naríbbi, pret. v. o naríbba ; a batyo bammaa ba - todas las personas se dispersaron. naríbessi, pre/. v. o naríbba ; a batyo ba mmaa ba - todas las personas se dispersaban, o tonorí álle to - los pájaros también se dispersaban. naríbia, v. ahuyentar, espantar. disper sar ; e ekukuu e lá - a batyo el trueno espanta a las personas. Pret. naríbiia, naríbiesiia. naríbiesiia, pret. v. o naríbia ; a bollá ba - e besoppé los niños espantaban a las ardillas. naríbiia, pret. v. o naríbia ; a bOllá ba - i ko''e los niños esp', NULL, 'o áppa', 'Fuente: bubi-español', 'import-script'),
  ('narnrno', 's.', NULL, NULL, NULL, NULL, 'sing. y pi. dátil de la palmera de acei te. Cls. 9 y 10. Tb. pi/lá. nánáa, v. enganchar, enredar; to la - e riotté nosotros enredamos la red. Pret. náníi, nánéssi', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('natta', 's.', NULL, NULL, NULL, NULL, 'sing. y pi. biznieto. Cls. 9 y 10. nawera, v. remar; a baobbe ba lá - la e benne be ábo los pescadores reman con sus dedos. Pret. naweria, naweresiia. naweresiia, pret. v. o nawera ; tue ammaa to - la e pullá todos nosotros remábamos con el huracán. naweria, pret. v. o nawera ; a batyo ba la e pullá las perso nas remaron con el huracán. Nchana, antrop. formado a partir de la expresión n tyá na ''u. Ntyána se loca liza en BOS080. Nchaso, an/rop. construido a partir de la expresión n tyá soou. Debería escri nekku / 241 birse Ntyasso. Se localiza en Basakato de la Sagrada Familia', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Ndele', 'antrop.', NULL, NULL, NULL, NULL, 'que significa "camino", "sendero". Ndele se localiza en Moka. ne, 1. prl!f suj. yo. 2. formo verbo soy, estoy; botyo soy una persona, - hállo estoy aquí. né, mor:[. mi, mío. contracción del sufijo posesi vo -ro y el morfema é; o botyo - mi pariente, o bOllá - mi hijo, a bellá - mis lágrimas. Tb. -rí, -nyí', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('ne''í', 'S.', NULL, NULL, NULL, NULL, 'sing. y pI. berenjena, tomate. Cls. 9 y \O', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nebba', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. nieve. Cls. 9 y 10', NULL, 'pako pako', 'Fuente: bubi-español', 'import-script'),
  ('nebba', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. iguana, reptil comestible. Cls. 9 y \O. nebba, V. despertar a alguien; we le nebbe no me despiertes. Pret. nebbi, nebessi. nebbi, pret. V. o nebba ; n-e kario''e yo desperté a la gallina, o - o wéso''o o tú despertaste a tu amigo, a le - él/ella me despertó, to - desperta mos, \O bO - vosotros le despertasteis, ba e - ellos nos despertaron. nebea, v. despertarse, levantarse; a batyo ba Já - la e nokonoko la gente se despierta con el ruido. Pret. nebei, nebieseei. nebei, pret. V. o nebea ; n- la e nokonoko me desperté con el ruido. lb. ebei. nebessi, pret. V. o nebba ; n o oberíi ro wáae na á''a wéi yo despertaba a mi madre pero había muerto. nebieseei, pret. v. o nebea ; a baitta ba - la o loé \O a batyo bá e tyélle los altos dig natarios se despertaban con los lloros de las per sonas de la cárcel. lb. ebieseei. nebiilea, V. estirarse, desentumecer; e puá e lá - e ebari el perro se estira por la mañana. Pret. nebolei, nebOleseei. nebiilei, pret. v. o nebolea ; a batyo ba - las', NULL, 'o ebba', 'Fuente: bubi-español', 'import-script'),
  ('Neka', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir del verbo o neka. Se localiza en Baney. nekekessi, pret. V. o nekekka ; a bayolla ba áó ba tá - ba sessi la i pohá i ábo nuestros abuelos no dudaban cuando rea lizaban sus hazañas. nekekia, V. aflojar, debilitar; to la - e eta póllo nosotros aflojamos la lona. Pret. nekekiia, nekekiesiia. nekekiesiia, pret. V. o nekekia ; n bo - ii biisiirí ro yo aflojaba mi cordón. nekekiia, pret. V. o nekekia ; n e - e etapóllo yo aflojé la lona, o bi - e bitapóllo tú aflojaste las lonas, a bo - o bOsorí él/ella aflojó el cordón, to - noso tro� aflojamos, \O - vosotros aflojasteis, ba - ellos/ellas aflojaron. nekekka, V. dudar, titubear; tyommaa o bulabotyo tyi - jamás duda un defensor. Pret. nekekki, nekekessi. nekekki, pret. V. o nekekka ; n ta - Ieláe no dudé ni un ápice', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nekku', 'S.', NULL, NULL, NULL, NULL, 'pI. verduras amargas. hierba moras. CI. 10. Tb. na ''u. 242 / nélaam nélaam, pret. v. o nélalla ; to o bosekke nosotros clava mos la tabla de madera, to bo - lo clavamos. nélalessi, pret. v. o nélalla ; o bobáa i tyóbbo a - o bosekke el hacedor de las casas clava ba la tabla de madera. nélalla, v. clavar, crucificar; e kapinta e lá o bosekke el carpintero clava la tabla de madera. Pret. nélaam, nélalessi', NULL, 'o nettá', 'Fuente: bubi-español', 'import-script'),
  ('nellá', 'adj.', NULL, NULL, NULL, NULL, 'indo otro, otra, otros, otras. Concuerda con las palabras de las Cls. 9 y 10; nabba - otro animal, otra carne, kollo - otras sardinas. nélOlessi, pret. v. o nélolla ; to - e tyal lá nosotros desclavábamos la chapa de zinc. nélolla, V. desclavar; e kapióta e lá - e tyallá el carpintero des clava la chapa de cinc. Pret. nélori, nélolessi. nélOri, pret. V. o nélolla ; e besekke m be - las tablas de madera las desclavé', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nene', 'adj.', NULL, NULL, NULL, NULL, 'bello, hermoso, bonito, agradable. Con cuerda con las palabras de las Cls. 9 y 10 ; e nabba - un hermoso animal, i bappa - unas bonitas serpientes', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Nepi', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse Neppí. Se localiza en Baney', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('neppí', 'S.', NULL, NULL, NULL, NULL, 'sing. y pI. cantante, músico. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('neppó', 'S.', NULL, NULL, NULL, NULL, 'sing. y pI. sobrino, el hijo de la herma na. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('néri', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. clavo. Cls. 9 y 10', NULL, 'tokko', 'Fuente: bubi-español', 'import-script'),
  ('Neta', 'antrop.', NULL, NULL, NULL, NULL, 'que parece provenir del verbo o net tá. Se localiza en Baney. netessi, pret. V. o nettá ; n-e biho''o lÍl yo clavaba mis postes. Tb. né/alessi. nettá, v. clavar, incrustar; i kapinta kubbaa i lá - ollé todos los carpinteros clavan algo. Pret. netyí, netéssi. T b. o nélalla. netyí, pret. V. o nettá ; n- o bosekke yo clavé la tabla de madera, o - o lo''obbá e ello wela tú incrustaste el cuchillo en el ñame, a - e kurússu él/ella clavó la cruz, to - a baallá ba áí nosotros clavamos sus manos, 10 - clavasteis, ba - clavaron. Tb. o né/ori', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Nikobara', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir del verbo o nokObáára. Se refiere a alguien que traga sin masticar mucho. Se localiza en Baney. Njuhaleri, antrop. que debería escri birse Nhuáaleri. Se localiza en Riaba', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nkobbe', 's.', NULL, NULL, 'Cl. 5', NULL, 'sing. árbol del plátano. . Tb. rikobbe', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nkuáaó', 'adv.', NULL, NULL, NULL, NULL, 'ahora, en este momento; ne''a poes si - acabo de llegar ahora. Tb. tyútyulé, dyíto, lá/a, láolé, nkuáhoole', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nkuáhoole', 'adv.', NULL, NULL, NULL, NULL, 'ahora, ahora mismo, en este momento. Se localiza entre los usuarios de Baney. Tb. tyútyulé, dyíto, /ála, láolé, nkuáaó. nkutessi, pret. V. o nkutta ; n-me fastidiaba, o - te fastidiabas, a - se fastidiaba, to - nos fastidiábamos, 10 - os fastidiabais, ba - se fastidiaban. nkutta, v. fastidiarse, perder; ba lá - lello ellos/ellas se fastidian hoy. Pret. nkutyi, nkutessi. ukutya, V. fastidiar, hastiar, aprovecharse de alguien; e enokonokko e lá - o tonokonokko el ogro fastidia a los pequeños ogros. Pret. nkutyia, nku tyesia. nkutyesia, pret. V. o nkutya ; to bo - o bosubári nosotros nos aprove chábamos de la benjamina. nkutyi, pret. V. o nkutta ; n-me fas tidié, n ka - me he fastidiado. nkutyia, pret. v. o nkutya ; 10 le - me habéis fastidiado, os habéis aprovechado de mí', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nmollo', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. aguja, alfiler grande. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nná', 'S.', NULL, NULL, NULL, NULL, 'sing. y pI. espalda, dorso. Cls. 9 y 10 ; o herá e - lle var en la espalda, e - pua detrás, ao ? ¿qué tal?', NULL, 'hNná', 'Fuente: bubi-español', 'import-script'),
  ('nnabí''o', 'adv.', NULL, NULL, NULL, NULL, 'atrás, detrás, detrás de; pellá e siéntate por la parte de atrás', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nnápua', 'adv.', NULL, NULL, 'Cl. 10', NULL, 'detrás; e - e eriia detrás del pueblo, a espaldas del pueblo. nne, moif. numo cuatro. Concuerda con las pala bras de la ; nabba yé - cuatro animales. nokkó / 243 nné, 1. morj: numo uno. Concuerda con las pala bras de la ; eriia é - un poblado. 2. prono sing. otro, otra. Concuerda con las palabras de la CL 7; elo eriia, e - este pueblo, el otro. úne, prono yo ; - ne bOllá yo soy un niño', NULL, NULL, 'Fuente: bubi-español', 'import-script');

-- Lote 162 (entradas 4026 a 4050)
INSERT INTO dictionary_entries (
  bubi, word_type, gender, number, nominal_class, plural_form,
  spanish, examples, variants, notes, created_by
) VALUES
  ('nno', 'adv.', NULL, NULL, NULL, NULL, 'suelo, abajo; o - abajo. nnolla, V. resucitar, reanimar; botyo ata pá''e o - o na á''a wéi la persona no se puede resucitar si ha muer to. Pret. nnori, nnuessi. nnorea, V. resucitarse, reanimarse; o botyo e''a binni o o motóo a la - la persona que fue atropellada por el coche se reanima. Pret. nnorei, nnueseei. nnorei, pret. v. o nnorea ; o lá o bollá e eruppé a - dicen que el hijo de Dios resucitó. nnori, pret. v. o nnolla ; n-o botyo e''a wéi ó yo resu cité a la persona que había muerto, o e - e puá tú reanimaste al perro, a - rea nimó, to - reanimamos, Iii - reanimasteis, ba reanimaron. nnueseei, pret. V. o nnorea ; e sipós si si -la i kollo el gato se reanimaba con las sardinas. nnuessi, pret. V. o nnolla ; to - e beatta bi áó noso tros resucitábamos nuestras historias. no''ía, pret. v. o no''iáa ; n ba a biitá calenté el aceite. no''iáa, V. calentar, templar; to la - a biitá nosotros calentamos el aceite. burlar, molestar; wele no''ie no me molestas. Pret. no''ía, no''iesiia. no''iesiia, pre', NULL, 'o lóa', 'Fuente: bubi-español', 'import-script'),
  ('nobanoba', 'S.', NULL, NULL, NULL, NULL, 'sing. y pI. bostezo. Cls. 9 y 10. nobba, V. bostezar; a batyo ba lá - kóri o bosabóatta a la to''ólla la gente bosteza porque el narrador está hablando. Pret. nobbi, nobessi', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nobbe', 'S.', NULL, 'sing.', NULL, NULL, 'y pI. enfado, enojo, cabreo. Cls. 9 y 10. nobbi, pret. V. o nobba ; e ko''e e - la gallina bostezó', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('noberí', 'S.', NULL, NULL, NULL, NULL, 'sing. y pI. sed. ganar. Cls. 9 y 10; - kobó mucha sed, n Iii''á e - o tengo ganas de ti. nobessi, pret. V. o nobba ; o boie Ól a mi padre bostezaba. Noconoco, antrop. cuyo significado encontramos en Nokonoko. Se localiza en Bare só. noessi, pret. V. o nooa ; o sessi la o boatta o n - cuando conta bas tu historia me reía. nóessi, pret. V. o nóa ; to - i pillá nosotros molíamos los dátiles. noessitooa, pret. v. o noatooa ; n- o towessi lá me reía cuan do hablabas, o - o''a lokki lá te reías cuando dormías, a - se reía, to tue ammaa nos reíamos todos, lo - os reíais, ba - se reían. Noha, antrop. que debería escribirse Nooa. Se localiza en Baney y en Basakato de la Sagrada Familia. nói, pret. V. o nóa ; Iii - e bekobbe molisteis los plá tanos. noitooa, pret. v. o noatooa ; n - sóté me reí mucho, o - o opullo te reíste en el pasado, a - se rió, to - bó botyíó nos reímos anoche, Iii - os reísteis, ba - se rieron', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nokké', 'S.', NULL, NULL, NULL, NULL, 'sing. y pi. manantial, fuente natural, f uente. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nokko', 's.', NULL, NULL, NULL, NULL, 'sing. y pi. ojo, vista. Cls. 9 y 10 ; herá aho i - pon allí los oj os, vigila, presta atención, pulóo o pe ¡-o lorá ven y da a tus ojos alimento', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nokkó', 'S.', NULL, NULL, NULL, NULL, 'sing. 1. arcoiris. ninfa, hada, mujer del río en la mitología popular de Guinea Ecuatorial, y por medio de la cuál se pueden obtener toda clase de favores, desde hacer el bien hasta desear y hacer el mal a alguien. Cls. 9 244 / Noko y 10. 2. arco. el. 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Noko', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse Nokkó o Nokko. Se localiza en Baney. nokobbia, v. alborotar, hablar en voz alta, etc. ; a batyo ba lá - líke las personas hablan mucho. Pret. nokobiia, nokobiesiia. nokobiera, v. engullir, tragar, devorar; e elo''á e lá - a baobbe el mar engulle a los pescadores. Pret. nokobieriia, nokobieresiia. nokobieresiia, pret. v. o nokobiera ; e erukurukku e - e pórñ la boa devoraba a la cabra. nokobieriia, pret. v. o nokobiera ; o lüebba lo - o boobbe la gran ola tragó al marinero. nokobiesiia, pret. v. o nokobbia ; bó botyíó a batyo bá é eriia ba anoche las personas del pueblo hablaban en voz alta. nokobiia, pret. v. o nokobbia ; n- hablé en voz alta, o -hablaste en voz alta, a - habló en voz alta, etc', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nokonoko', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. alboroto, ruido, bulla. els. 9 y 10. nokuera, v. dormir profundamente; o botyi bíi bo tyuáría n la - el cansancio me hizo dormir profunda mente. Pret. nokueri, nokueressi. nokuerea, v. echar un sueñecito, dormitar, fingir que se duerme. Pret. nokuerei, nokueresei. nokuerei, pret. v. o nokuerea ; n-ele atoo eché un sueñecito esta tarde. nokueresei, pret. v. o nokuerea ; we le poe - cuando llegaste dormitaba. nokueressi, pret. v. o nokuera ; lue le poe to - cuando llegasteis dormía mos profundamente. nokueri, pret. v. o nokuera ; ne le sétye e elako n - al terminar el trabajo dormí profundamente', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Nokonoko', 'antrop.', NULL, NULL, NULL, NULL, 'que aparece a veces escrito como Noconoco. Presenta dos significados. En primer lugar, se referirá al "alboroto" o al "ruido de voces". En este caso se escribirá Nokonoko. En segundo lugar, se referirá al "ogro". En este caso se escribirá Enokonokko. Se localiza en Baresó', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Nole', 'antrop.', NULL, NULL, NULL, NULL, 'que parece una transcripción errónea de nalle. Se localiza en Baney', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nono''o', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. sien. els. 9 y 10. Ej. expr. i - m i lá kokóssa na ÍI la ráa mis sienes se mue ven cuando como. non ora, v. delatar, acusar; e biobéolla bi lá e kobinna los ancianos acusan al gobierno. Pret. nonoria, nono resiia. nonoresiia, pret. v. o nonora ; o mmása o lo bo - a tu jefe le delatabais. nonoria, pret. v. o nonora ; o mmá sa o m bo - a tu jefe le delaté', NULL, 'o rikora', 'Fuente: bubi-español', 'import-script'),
  ('nonowé', 's.', NULL, NULL, NULL, NULL, 'sing. y pi. vagabundo, proscrito, nómada. desertor. els. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nooa', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. serpiente. els. 9 y 10. nooa, v. 1. reírse; o - tooa reírse; n la - tooa me río, o la - tooa te ríes, a la - tooa se rie, etc. 2. asar. Pret. nooi, noessi. nooi, pret. v. o nooa ; n-me reí, o - te reís te, a - se rió, to - nos reímos, lo - os reísteis, ba - se rieron. nópibia, v. aspirar rapé por la nariz, esnifar; o - botyo fastidiar o molestar a alguien. Pret. nóbi biia, nópibiesiia. nópibiesiia, pret. v. o nópibia ; e obéolla e - el anciano esnifaba. nópibiia, pret. v. o nópibia ; e bappa e - e betoolÍl la serpiente esnifó las cenizas. notelessi, pret. v. o notella ; o mmása a - o bolakoláko el jefe acechaba con la mira da al trabajador. notella, v. acechar con la mirada, atisbar, con templar. Pret. noteri, notelessi. noteri, pret. v. o notella ; n si - e sipóssi aceché al gato con la mirada. notessi, pret. v. o notta ; ripotto n-en la ciudad miraba fijamente. notta, v. mirar fijamente, acechar con la mira da. Pret. nótyi, nótessi', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nótto', 's.', NULL, NULL, 'Cl. 1', NULL, 'pI. cuerpos. el. 10. '' notya, v notyesiia. . vigilar atentamente. Pret. nótyía, nótya, v. mascar, rumiar; e pókkó e lá - el buey rumia. Pret. nótyía, nótyesiia. nué / 245 jero se obstruye con el barro. Pret. ntéi, nteseei. nótyesiia, pret. v. o nótya ; n elol\ó yo mascaba una corteza, o - simeressi tú mascabas un medicamento, a - sibáka él mascaba tabaco, to si - e sibáka nosotros mascá bamos el tabaco, 10 - vosotros mascabais, ba ellos mascaban. notyesiia, pret. v. o nótya ; tue - e húbbé nosotros vigilábamos al ladrón atentamente. notyi, pret. v. o notta ; 010 botyo a - sóté a tyibbi esta persona miró tanto fijamente que se cansó. notyía, pret. v. o notya ; e kobinna tue - al gobierno le vigilamos atenta mente. nótyía, pret. v. o nótya ; e pókkó e - el buey rumió. notyonotyo, s. sing. y pI. 1. herbá cea que forma matorrales de rizomas rastreros. 2. fr uto de esta planta. Clases 9 y 10. ntá, 1. s. sing. señor, padre, tío, don. . El plu ral de la se expresa de la forma siguiente: a bé ', NULL, 'okokue', 'Fuente: bubi-español', 'import-script'),
  ('Ntere', 'antrop.', NULL, NULL, NULL, NULL, 'construido a partir de la expresión n te ri. Ntere se localiza en Basaka to de la Sagrada Familia. nteseei, pret. v. o ntéa ; o bukká bo. ntesei, pret. v. o nti�a ; e biséné bi - las pequeñas ardillas se limpiaban el ano. ntessi, pret. v. o nta ; n-o bollá yo limpiaba el ano del niño. ntessi, pret. v. o ntá ; a batyo ba - i pi''í las personas obstruían los agujeros. Mora, v. dañar, hacer daño en una herida; o la le ótora me haces daño en la herida, we le ótore no me hagas daño en la herida. Pret. ntoriia, IÍto resiia. I Ítoresiia, pret. v. o IÍtora ; bOlo boatta bo - a batyo bammaa esta noticia dañaba a todas las personas. I ÍtOriia, pret. v. o ntora ; n bO - o bOllá dañé al niño. ntyi, pret. v. o nta ; n-o bollá limpié el ano del niño. ntyí, pret. v. o ntá ; a baoppo ba - o bukká el aluvión obs truyó el agujero', NULL, 'o itóra', 'Fuente: bubi-español', 'import-script'),
  ('nué', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. abeja. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
