  ('o''é', 'S.', NULL, NULL, NULL, NULL, 'sing. última voluntad, testamento. CI. 7. Tb. hiiloe, miiloe. yO''é" o''elessi, pret. V. o o''ella ; bO - a batyo o boheru sentías nostalgia por tu gente. o''ella, v. escuchar o sentir por alguien; n la bOtyo IOsisi siento nostangia por alguien. Pret. o''em, o''elessi. O'' em, pret. V. o o'' ella ; n ka o - o boatta ba sessi bO a banapana escuché por ti la historia que narraban los estudiantes. o''essi, pret. V. o o''áa ; n - comprendía, bO - comprendías, o comprendía, ro - comprendíamos, 10 - comprendíais, ba comprendían. ó''essi, pret. V. o ó''a ; n yo entendía, bO - tú entendías, o - él entendía, to - nosotros entendíamos, 10 - vosotros entendíais, ba - ellos entendían. ó''i, pret. V. o ó''a ; n ka - o boatta bo mmé escuché la historia de la madre. 250 / ó''ia ó''ia, v. 1. despedirse; n la ba - me despido, n la ba - o me despido. 2. afirmar, asegurar; o botyo fu a le - e bilabba mi pariente me aseguró los hechos. 3. hacer sentir. Pret. ó''íia, ó''iesiia. 4. o - boroo deleitar. ó''iesiia, pret. v. o ó''', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
