  ('oé', 's.', NULL, NULL, 'Cl. 7', NULL, 'sing. algo. ; ké - ¿qué pasa? Tb. ollé. oea, v. lavarse, bañarse; n la - la boppé bá hlÍlÍé me lavo con agua caliente. Pret. oei, oeseei. oei, pret. v. o oea ; n - me lavé, bo - te lavaste, o - se lavó, to nos lavamos, lo - os lavasteis, ba se lavaron. oeseei, pret. v. o oea ; e puá - e eribba wela el perro se bañaba en la charca. oessi, pret. v. o ooa ; a balakoláko ba - o mmássa ábO los trabajadores rechazaban a su jefe. Tb. koe�''Si. okanori I 253 oessi, pret. v. o ooa ; ne - e akákka yo lo lavaba, el cubilete de coco, we - e torosíssi tú lo lavabas, el pantalón, tue e tyóbbo nosotros lavábamos la casa. ohá, v. moler, machacar, amasar; to la - i tolla amasamos el tolla. Pret. ohí, ohessi. oháa, v. decir, hablar; ká o la -le? ¿qué dices? Pret. ohíi, ohessi. ohálessi, pret. v. o ohálla ; o botúkúaari - a batyo ba e eriia wela ba bo iálle la alcaIde sa solicitaba la colaboración de la gente del pue blo para que le ayuden. ohálla, v. solicitar la ayuda o la colaboración de alguien en la ', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('ohello', 's.', NULL, NULL, 'Cl. 3', NULL, 'sing. futuro, devenir. . ohessi, 1. pret. v. o ohá ; e sarítyityi si - i tolla elo ebari la viejecita molía el Urophyllum rubens esta mañana. 2. pret. v. o oháa ; n ta - Iabba yo no decía nada. ohí, pret. v. o ohá ; e emasíín - e beakká la máquina molió las almendras. ohía, pret. v. o ohiá ; e sine''e si - o biirihí el bebé fue poseído por el espíritu de Borihí. ohiá, v. ser poseído por un espíritu; elo elottyí e lá - a Borihí este sier vo es el que posee el espíritu de Borihí. Pret. ohía, ohiesiia. ohiera, v. invocar a un espíritu para alguien; e boyolla tyuíi, ohielá lee abuelo, por favor, invo ca a un espíritu para mí. Pret. ohieria, ohieresiia. ohieresiia, pret. v. o ohiera ; o boyolla e - el abuelo invocaba su espíritu para que nos atendiera. ohieria, pret. v. o ohiera ; o bOllá a - a batyo ba pooi bá el niño invocó a su espíritu para la gente que llegó. ohiesiia, pret. v. o ohiá ; e aríoIla - e tyibba la anciada era poseída por el espíritu de Tyibba. ohíi, pret. v. o oháa ; lalo l', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('ohittá', 's.', NULL, NULL, 'Cl. 3', NULL, 'sing. cacería, caza. . oíia, pret. v. o oyáa ; n bo - o bosorí apreté el cordón. okaan, pret. v. o okanna ; n ba a batyo yo reuní a las personas. okáera, v. atacar a una personas entre varias; a batyo ba la - e húbbé la gente ataca al ladrón. Pret. okáeria, okáeresiia. okáeresiia, pret. v. o okáera ; a abitábítta ba - o botyo a e eriia ro los militares atacaban todos a mi paisano. okáeria, pret. v. o okáera ; a bakuerakueráa ba tá le - kóri n húbiia los alumnos no me atacaron porque huí. okalessi, pret. v. o okalla ; n yo abarcaba, bO - tú abar cabas, o - él abarcaba, to - nosotros abarcábamos, \O - vosotros abarcabais, ba - ellos abarcaban. okalla, v. abarcar, reunir, sumar, amontonar, unir; o - beaó sumar deudas. Pret. okam, okari, okalessi. okam, pret. v. o okalla ; n abarqué, bo - abarcaste, 0 abarcó, to - abarcamos, lO abarcasteis, ba - abarcaron. okanessi, pret. v. o okanna ; n a batyo yo reunía a las personas. okanna, v. unir, reunir, abarcar, sumar, amon tonar, congregar; n la ', NULL, 'o okanna', 'Fuente: bubi-español', 'import-script'),
