  ('Oki', 'antrop.', NULL, NULL, NULL, NULL, 'que significa "ñame". Se loca liza en Moka. okia, pret. v. o okkiá ; a bi''ó ba le - la fiebre me agotó. okiesüa, pret. v. okkiá ; o botyibíi bo le - el cansancio me agotaba. okka, v. cansarse, agotarse. reunir. recoger, coger. Pret. okki, okessi. okka, v. recoger ; o bonatú''o ro a la - bato''a mi hermano mayor recoge ñames aéreos, - o tokollé o recoge tus cosas. Pret. okki, okessi. okkáa, v. tener, poseer; to la - ri''uáa tenemos suerte. juntar, aglutinar. obtener. Pret. okkíi, okessi. okki, 1. pret. v. o okka ; n -la e elako me agoté con el trabajo. 2. s. sing. un tipo de ñame. el. 7. Tb. eokki. okki, pret. v. o okka ; n - recogí del suelo, bo - recogiste del suelo, o - recogió del suelo, to - recogimos del suelo, lo - recogisteis del suelo, ba - recogieron del suelo. okkiá, v. cansar, agotar, baldar; o loetto lo lá le - el trayecto me agota. Pret. okía, okiesiia. okkü, pret. v. o okkáa ; n - elako tengo trabajo, tengo algo qué hacer', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
